import styled from '@emotion/styled';

export const Items = styled.ul`
  display: flex;
  flex-direction: column;
  padding: 0;
`;

export const Item = styled.li`
  display: flex;
  /* justify-content: space-between; */
  align-items: center;
  width: 320px;
  padding: 0;
  margin-bottom: 10px;
`;
